const GetCurrentlyWatchingQuery = `query GetCurrentlyWatching {
	currentUser {
		id
		displayName
		activity {
			... on Watching {
				user {
					broadcastSettings {
						game {
							displayName
						}
						title
					}
					channel {
						socialMedias {
							name
							title
							url
						}
					}
					id
					displayName
					profileURL
				}
			}
		}
	}
}
`

